import { Switch, Route } from 'react-router-dom';
import './App.css';
import Game from './pages/Game.jsx';

class App extends React.Component {
  render() {
    return (
    <Switch>
      <Route exact path="/" component={ Game } />
    </Switch>)
  }
}

export default App;
